import React from "react";
import { StyledUl, Button, StyledDiv } from "./Styled";
import { HealthyHome, ZombieHome, EmptyHome } from "../../svg-icons";

const ScenarioTemplate = ({ data, text, day }) => {
  let lastId = 0;
  const scenarioItems = data.map((i, number) => {
    return (
      <StyledUl key={number}>
        {data[number].map((i) => {
          lastId++;
          if (i === 2) {
            return (
              <li key={lastId}>
                <ZombieHome />
              </li>
            );
          } else if (i === 1) {
            return (
              <li key={lastId}>
                <HealthyHome />
              </li>
            );
          } else {
            return (
              <li key={lastId}>
                <EmptyHome />
              </li>
            );
          }
        })}
      </StyledUl>
    );
  });

  return (
    <StyledDiv>
      <p>Day: </p>
      <p>{text}</p>
      {scenarioItems}
      <Button onClick={console.log("hey")}>Play animation</Button>
    </StyledDiv>
  );
};

export default ScenarioTemplate;
